import React, { useEffect, useRef } from "react";
import SideImage from "./SideImage";

export default function Home() {
  return (
    <div className="main-container">
      <div className="lab-header-wrapper">
        <img
          src="images/labheader.jpg"
          alt="lab-header"
          className="lab-header"
        />
      </div>
      <SideImage header="LEFT HEADER" text="left text" imageLink="images/emptybeakers.jpg" left="1" />
      <SideImage header="RIGHT HEADER" text="right text" imageName="images/labworking1.jpg" />
    </div>
  );
}
